const NavbarMenu = [{
    id: 1, path: "/", PName: "Home", icon: "fas fa-home mx-2"
},
{ id: 2, path: "/Buy-Gold", PName: "Buy", icon: "fas fa-shopping-bag mx-2" },
{ id: 3, path: "/Sell-Gold", PName: "Sell", icon: "fas fa-shopping-bag mx-2" },
{ id: 4, path: "/Gift", PName: "Gift", icon: "fas fa-gift mx-2" },
{ id: 5, path: "/Delivery", PName: "Delivery", icon: "fas fa-truck mx-2" },
{ id: 6, path: "/SIP", PName: "SIP" },
{ id: 7, path: "/Jewellery", PName: "Jewellery" }]

export default NavbarMenu;
